        <figcaption>
            <p id="chartNotes-1163813105" class="figure-note">
                Notes: “Enhanced Medicaid Matching” designates the increased Federal Matching Assistance Percentage (FMAP) for states passed in the Families First Coronavirus Response Act and is represented in the figure as separate from other medicaid or coronavirus spending. “Everything else” includes the following budget functions: agriculture, energy, natural resources and environment, community and regional development, employment and training, administration of justice, and veterans’ benefits and services. “Income security” includes the social services budget subfunction. “Other Health” includes all items in the health budget function other than Medicaid and the Medicare Part D “clawback,” a payment from states to reimburse the federal government for certain costs, which is included in the Medicaid category. “COVID-19 Aid” indicates COVID-19 relief spending with the exception of Medicaid FMAP based on the data available from Federal Funds Information for States’ (FFIS) as of Nov. 10, 2020. FFIS, the source of the data, says that its database accounts for more than 90% of federal funds going to state and local governments. Data reflect enacted funding levels and the most recent state allocations available.
            </p>
            <p class="figure-note figure-note--source">
                Source: R. Rudowitz, B. Corallo, and R. Garfield, “How Much Fiscal Relief Can States Expect from the Temporary Increase in the Medicaid Fmap?”, (Jul. 22, 2020), <a href="https://www.kff.org/report-section/how-much-fiscal-relief-can-states-expect-from-the-temporary-increase-in-the-medicaid-fmap-appendix/">https://​www.​kff.​org/​report-​section/​how-​much-​fiscal-​relief-​can-​states-​expect-​from-​the-​temporary-​increase-​in-​the-​medicaid-​fmap-​appendix/​</a>; Federal Funds Information for States, “Ffis Estimated State Funding for Coronavirus Pandemic”, <a href="https://ffis.org/system/files/private/publications/2021/ffis_covid-19_state-by-state_allocations_16.xlsx">https://​ffis.​org/​system/​files/​private/​publications/​2021/​ffis_covid-​19_state-​by-​state_allocations_16.​xlsx</a>; Federal Funds Information for States, “FFIS Grants Database,” <a href="https://ffis.org/database">https://​ffis.​org/​database</a>
